/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `getNextRecord`(p_stype varchar(30), changeType INT,isDispute int)
BEGIN
DECLARE nextid INT DEFAULT 1;
DECLARE nextword VARCHAR(50);
DECLARE stype varchar(30);
DECLARE nextseed varchar(30);
DECLARE nextroot varchar(30);
IF (isDispute=1)
THEN
IF EXISTS(select 1 from disputeDictionary d where d.processed=0)
THEN
select dt.id,dt.seed ,dt.word,dt.type,dt.rootWord into nextid,nextseed,nextword,stype,nextroot from disputeDictionary dt
where dt.seed!=dt.word  and dt.processed=0 order by similarity desc LIMIT 1;
update disputeDictionary set processed=1 where id=nextid;
select nextid,nextseed,nextword,stype,nextroot;
END IF;
ELSE
IF (changeType=1)
THEN
IF EXISTS(select 1 from supportDictionary d where d.type!= p_stype and d.processed=0)
THEN
select dt.id,dt.seed ,dt.word,dt.type into nextid,nextseed,nextword,stype from supportDictionary dt
where dt.seed!=dt.word and dt.type!= p_stype and dt.processed=0  order by similarity desc LIMIT 1;
update supportDictionary set processed=1 where id=nextid;
select nextid,nextseed,nextword,stype,nextroot;
END IF;
ELSE
IF EXISTS(select 1 from supportDictionary d where d.type= p_stype and d.processed=0)
THEN
select dt.id,dt.seed, dt.word,dt.type into nextid,nextseed,nextword,stype from supportDictionary dt
where dt.seed!=dt.word and dt.type= p_stype and dt.processed=0 order by similarity desc  LIMIT 1;
update supportDictionary set processed=1 where id=nextid;
select nextid,nextseed,nextword,stype,nextroot;
END IF;
END IF;

END IF;

END */;;
