/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `insertDictionary`(seed varchar(30),stype varchar(30), data varchar(8000),delimiterCount int,isDispute int, rootWord varchar(30))
BEGIN
DECLARE wordCount INT DEFAULT 1;
DECLARE singleWord VARCHAR(50);
IF (isDispute=0) THEN
     WHILE wordCount  <=  delimiterCount DO
                   SELECT SPLIT_STR(data, ';', wordCount) INTO singleWord;
                   INSERT INTO supportDictionary(seed,word,similarity,type,processed) VALUES
							(seed,
							(SELECT SPLIT_STR(singleWord, ',', 1)),
							(SELECT SPLIT_STR(singleWord, ',', 2)),
							stype,
							0);
                   SET  wordCount = wordCount + 1;
	END WHILE; 
ELSE 
 WHILE wordCount  <=  delimiterCount DO
                   SELECT SPLIT_STR(data, ';', wordCount) INTO singleWord;

                   INSERT INTO disputeDictionary(seed,word,similarity,type,processed,rootWord) VALUES
							(seed,
							(SELECT SPLIT_STR(singleWord, ',', 1)),
							(SELECT SPLIT_STR(singleWord, ',', 2)),	
							 stype,
							0,
							rootWord);
                   SET  wordCount = wordCount + 1;
	END WHILE; 
END IF;
END */;;
